import styled from "styled-components";

const BoxSearch = styled.div`
   padding-bottom: 2%;
`
const Input = styled.input`
   border-radius: 20px;
`
const Boton = styled.button`
   border-radius: 20px;
`

export default function SearchBar({OnSearch}) {
   return (
      <BoxSearch>
          <Input type='search' />
         <Boton onClick={(id) =>{OnSearch(id)}}>Agregar</Boton>
      </BoxSearch>
   );
}
